import React from 'react';
import SearchBar from './components/SearchBar';
import EmojiList from './components/EmojiList';

const emojis = require('emoji.json')

const App = () => {


  return (
    <div>
      <h1>Emoji Search</h1>
      <SearchBar onformSubmit={null} />
      <EmojiList emojis={emojis.name}/>


    </div>
  )
}
export default App
